pragma solidity ^0.8.0;

contract GameStore {
    struct Game {
        string title;
        string description;
        uint price;
        address owner;
        bool isForSale;
    }

    mapping(uint => Game) public games;
    uint public gameCount;

    function addGame(string memory _title, string memory _description, uint _price) public {
        gameCount++;
        games[gameCount] = Game(_title, _description, _price, msg.sender, true);
    }

    function getGame(uint _gameId) public view returns (string memory title, string memory description, uint price, address owner, bool isForSale) {
        Game storage game = games[_gameId];
        return (game.title, game.description, game.price, game.owner, game.isForSale);
    }

    function updateGame(uint _gameId, string memory _title, string memory _description, uint _price) public {
        Game storage game = games[_gameId];
        require(msg.sender == game.owner, "Only the owner can update the game");
        game.title = _title;
        game.description = _description;
        game.price = _price;
    }

    function buyGame(uint _gameId) public payable {
        Game storage game = games[_gameId];
        require(msg.value >= game.price, "Insufficient payment");
        require(game.isForSale, "Game is not for sale");

        address previousOwner = game.owner;
        game.owner = msg.sender;
        game.isForSale = false;

        payable(previousOwner).transfer(msg.value);
    }
}
